"use strict";
{
    //  start
    const findLargestNumber = (numbers) => {
        const result = Math.max(...numbers);
        return result;
    };
    // Sample Input:
    const result = findLargestNumber([10, 5, 8, 20, 3]);
    // Sample Output:
    console.log(result);
    // 20
    //   end
}
